import React, { Component } from 'react';
import './App.css';
import Logo from './components/Logo';
import Excel from './components/Excel';

class App extends Component {
  render() {
    return (
      <div id="pad" className="App">
        <h1>
         <Logo /> Welcome to The App!
       </h1>
       <Excel />
      </div>
    );
  }
}

export default App;
